/**
 * @description 首页
 */
import React from 'react';
import './index.less';
import Avatar from '@/components/Avatar';

const Home = () => {
  return (
    <div className='home'>
      <Avatar />
      <div className='home-center'></div>
      <div className='home-bg'>
        {/* 门 */}
        <div className='door'>
          <div className='door-beam'>
            <div className='tiaoliang'></div>
          </div>
          <div className='door-frame'>
            <div className='door-top'></div>
            <div className='door-line door-line-left'></div>
            <div className='door-line door-line-right'></div>
            <div className='door-frame'></div>
            <div className='door-opening'></div>
          </div>
        </div>
        {/* 门框 */}
        <div className='bg-shelf'>
          <div className='door'></div>
        </div>
        {/* 地板 */}
        <div className='bg-floor'></div>
      </div>
    </div>
  );
};

export default Home;
